import Post from './Post'

const Posts=(props)=>(
    <>
        {
            props.articles.map(a=>(
                <Post 
                    key={a._id}
                    title={a.headlines.basic}
                    image={a.promo_items.basic.url}
                    altImage={a.promo_items.basic.subtitle}
                    date={a.display_date}
                    link={a.website_url}
                />
            ))
        }
    </>
)

export default Posts
